import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <form>
      <fieldset>
        <label htmlFor="name">
          Name:
          <input 
          name="name" 
          id="name" 
          type="name" 
          style="text-transform: uppercase"
          maxLength='30' required></input>
        </label>

        <label>
          Email:
          <input name="email" id="email" type="email"></input>
        </label>

      </fieldset>
    </form>
  );
}

export default App;
